document.addEventListener("DOMContentLoaded",()=>{document.querySelectorAll(".premium-countup__wrap")?.forEach(e=>{var e=e.querySelector(".premium-countup__increment"),t=Number(e.getAttribute("data-interval"))/1e3,r=Number(e.getAttribute("data-delay")),n=Number(e.textContent);isNaN(n)||(e=new countUp.CountUp(e,n,{duration:t,useGrouping:!1,enableScrollSpy:!0,scrollSpyDelay:r,scrollSpyOnce:!0,useEasing:!1})).error||e.start()})});